import React from "react";
import '../css/side-nav.css';
import house from '../images/house.svg';

function SideNav() {
    return (
        <>
            <div className="side-nav-body">
                <div className="side-nav-item">
                    <img src={house} alt="House icon" />
                    <h3>Home</h3>
                </div>
            </div>
        </>
    );
}

export default SideNav;
